import React from 'react';
import {css, keyframes} from 'emotion'
import { MDBView, MDBMask} from "mdbreact";

import graduation from '../images/graduation.jpg'

const Graduation = () => {
    return (
            <MDBView hover zoom>
                <img
                    className={styles.graduation}
                    src={graduation}
                    alt=""
                />
                <MDBMask className={styles.classname} overlay="cyan-light">
                    <p>Graduation</p>
                </MDBMask>
            </MDBView>
    )
}



let classname = "flex-center";

const fadeInImage = keyframes ` {
    0% {
        width: 0%;
        height: 0%;
    } 
    // 30% {
    //     width: 20%;
    //     height: 20%;
    // }
    // 70% {
    //     width: 70%;
    //     height: 70%;
    // }
    100% {
        width: 100%;
        width: 100%;
    }
}`


const styles = {
    graduation: css`
    height: 100%;
    width: 100%;
    animation: ${fadeInImage} 1s ease-out;
    `,
    classname: css`
    color: white;
    font-size: 1.5em;
    font-weight: bold;
    cursor: pointer;
    `
}
export default Graduation;
